const API_BASE_PROD = 'https://listen-api.listennotes.com/api/v2';

const API_BASE_TEST = 'https://listen-api-test.listennotes.com/api/v2';

const defaultUserAgent = 'podcasts-api-js';

module.exports = {
  API_BASE_PROD,
  API_BASE_TEST,
  defaultUserAgent,
};
